import { Container, Grid } from "@mui/material";
import React from "react";
import useStyles from "./profile.style";
import { ResumePicture } from "../../ResumeData/ResumeData";


function Profile() {
    const styles = useStyles();
    console.log(ResumePicture)
    return (
        <Grid container spacing={2}>

            <Grid className={styles.profile} item xs={4}>
                <div className={styles.profilePicture}>

                    <img className={styles.profilePic} src={ResumePicture} alt='sdasd' />
                </div>
                <div className={styles.profileSVG}>
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 574.794 480.346">
                        <path id="Path_1" data-name="Path 1" d="M374.479,696.652s29.386-159.059,133.385-97.273S742,564.112,806,503.911s140.665,30.83,140.665,30.83V963.676H371.868Z" transform="translate(-371.868 -483.33)" fill="#222b45" />
                    </svg>

                </div>



            </Grid>
            <Grid item xs={5}>
                fgdfg
            </Grid>

        </Grid>
    );
}

export default Profile;
